import React from "react";
import "./List/css";

const List = (props) => {
  return (
    <div>
      <div className="body">
        <div>{props.list.title}</div>
        <div>{props.list.todo}</div>
      </div>
      <button
        className="btn"
        onClick={() => {
          props.delete(props.list.id);
        }}
      >
        삭제하기
      </button>
      <button
        className="btn"
        onClick={() => {
          props.done(props.list.id);
        }}
      >
        {props.list.isDone ? "취소" : "완료"}
      </button>
    </div>
  );
};

export default List;
